void quickSort(int tab[], int p, int r){
  if(p < r){
    int q = partition(tab, p, r);
    quickSort(tab, p, q - 1);
    quickSort(tab, q + 1, r);
  }
}

int partition(int tab[], int p, int r){
  int x = tab[r];
  int i = (p - 1);

  for (int j = p; j <= r- 1; j++) {
      if(tab[j] <= x){
        i++;
        int temp = tab[i];
        tab[i] = tab[j];
        tab[j] = temp;
      }
  }
  int temp = tab[i + 1];
  tab[i + 1] = tab[r];
  tab[r] = temp;

  return (i + 1);
}

void printArray(int tab[], int size){
  for (int i = 0; i < size; i++) {
    printf("%d ", tab[i]);
  }
}
